import React from 'react';
import './DisplayBug.css'

// #region constants

// #endregion

// #region styled-components

// #endregion

// #region functions

// #endregion

// #region component
const propTypes = {};

const defaultProps = {};

/**
 * 
 */
const DisplayBug = () => {

    const data = [
        {  name: 'John', age: 25 },
        {  name: 'Jane', age: 30 },
        { name: 'Bob', age: 35 }
      ];



      return <div class="wrapper">
                   <form class="comment-form">
                     <div className="headings">
                             <table>
                                <thead>
                                   <tr>
                                    
                                      <th>Name</th>
                                      <th>Description</th>
                                   </tr>
                               </thead>
                                <tbody>
                                   {data.map((item) => (
                                       <tr key={item.name}>
                                           <td>{item.id}</td>
                                           <td>{item.name}</td>
                                           <td>{item.age}</td>
                                      </tr>
                                   ))}
                               </tbody>
                           </table>
                     </div>     
                   </form>
     </div>;
}

DisplayBug.propTypes = propTypes;
DisplayBug.defaultProps = defaultProps;
// #endregion

export default DisplayBug;
